import React from 'react';

const Menu = () => {
    return (
        <div>
            <h2>Menú Completo</h2>
            <p>Explora todas nuestras opciones, desde hamburguesas hasta acompañamientos y bebidas.</p>
        </div>
    );
};

export default Menu;
